import React from "react";

const Home = () => {
    return(
        <div>
            <section id="home">
                <div className="container">
                    <div className="row justify-content-center">
                        <div className="col-md-8 mt-5">
                            <h1 className="display-4 fw-bolder mb-4 text-center">Feels the fresh business purspective</h1>
                            <p className="lead text-center fs-4 mb-5">Lorem ipsum dolor sit amet consectetur adipisicing elit. 
                            Labore distinctio officiis tempore repellat aliquam sapiente voluptate totam vero alias voluptates?</p>
                            <div className="buttons">
                                <buttons className="btn btn-light me-4 rounded-pill px-4 py-2">Get Quote</buttons>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </div>
    );
}

export default Home;
